const canvas = document.getElementById("canvas");
const ctx = canvas.getContext("2d");
const reader = new FileReader();
const img = new Image();
const img1 = new Image();
img1.onload = () => {

}
img1.src = "data:image/png;base64,";
console.log(img1.src);

const logo = new Image();
logo.onload = () =>{

}

logo.src =" data:image/png;base64,";

let name = "member";
let done = false;
const uploadImage = (e) => {
	reader.onload = () =>{
		img.onload = () =>{
			const wid = 1080;
			const hei = 1080;
			canvas.width = 1080; 
			canvas.height = 1080;
			ctx.fillStyle = "white";
			ctx.fillRect(0,0,1080, 1080);
			ctx.drawImage(img, 0, 0, wid, hei);
			ctx.strokeStyle = '#fff';
			ctx.font = "25px Arial";
			ctx.strokeText(name, 950, 40);
			ctx.drawImage(logo, 40, 40, 100, 100);
			ctx.drawImage(img1, 0, 864, 1080, 216);
		}
		img.src = reader.result;
		console.log(reader.result);
	}
	reader.readAsDataURL(e.target.files[0]);
	done = true;
} 

document.getElementById("uploader").addEventListener("change", uploadImage);

document.getElementById("name").addEventListener("change", ()=> {
	name = document.getElementById("name").value.toLowerCase();
});
const members = ["priti", "chaitanya", "shreyas", "om", "samarthi", "sanket", "gautam", "rutuja", "ambika", "rakesh", "pulkit", "sameer", "devyani", "pankaja", "shanya", "sahil", "shivkumar", "akash", "tejal", "chakradhar", "sanskriti", "saurabh", "namrata"];

const isValid = (member) => {
	return member == name;
}
const download = () =>{	
	console.log(name)
	if(members.find(isValid) && done){
		const image = canvas.toDataURL();
		const link = document.createElement("a");
		link.href = image;
		link.download = "badge-"+name+".png";
		link.click();
	}
	else{
		alert("Either you have entered your first name wrong or you are not member");
	}
}

document.querySelector("button").addEventListener("click", download);
